Namun ketika script sudah panjang kita perlu seksi tersendiri. Misalnya ini

```#!/usr/bin/env bash

### -- task controller --

function do_observe() {
    process_observe
} 

function loop_reply() {
    while true; do 
        process_reply   
        sleep 1
    done
}```

Ada yang pakai loop ada yang tidak

Jadi `do_observe` hanyalah sekedar fungsi untuk memanggil task `process_observe`.

```### -- controller --

function do_observe() {
  # no loop
    process_observe
}```

Lalu tambahkan fungsi `do_reply`di `controller`.

**04-controller.bash**

```#!/usr/bin/env bash

### -- task controller --

function do_observe() {
    process_observe
} 

function do_reply() {
    process_reply
}```

Lalu ada fungsi ini untuk mengurus `--opsi`

```# handling --command
function handle_command_optarg() {
  local command=$1

    case "$command" in
        version) 
            message_version
            exit;;
        help) 
            message_usage
            exit;;
        observe)
            do_observe
            exit;;
        reply)
            loop_reply
            exit;;
        *) 
            # Invalid Option
            message_usage
            exit;;
    esac
}```

