Kalo ane jawab "Yt" outputnya apa?

#!/Challenge/0x1

Terdapat 2 buah file yaitu file skripsi dan file yang berisi link jav. Seorang hacker dalam posisi root, yang ingin mencoba menghapus semua file dikarenakan dia telah disakiti. Saat menghapus semua file ternyata ada satu file yang tidak dapat dihapus.

Apa penyebab dan bagaimana caranya agar file terlarang tersebut dapat dihapus?

```x=0;
 oIFS=$IFS;
 IFS="|";
tail -n100 $FILE|while read a;do 
 y=0;
 for b in $a;
 do
  [[ $y -eq '6' ]] && [[ -n "$b" ]] &&  echo $x $a;
  y=$((y+1));
  done;
 x=$(($x+1));
done
 IFS=$oIFS;```

udah ketemu ğŸ˜, ternyata cuma pake kurung{buka|tutup}, pakai 'read -r' ngak ngena jadi di tambahin manual

```oIFS=$IFS;IFS="|";
tail -n10 $FILE|while read a;do a=($a);[[ -n ${a[6]} ]] && echo ${a[@]};done;
IFS=$oIFS```
